import React, { useEffect } from 'react';
import './CartPage.scss';
import { useState } from 'react';
class CartPage extends React.Component{
    constructor(props){
        super(props);
        this.state = {
            cartDetails : [],
        };
    } 

    componentDidMount(){
        this.setState({cartDetails:localStorage.getItem("cartDetails")})
    }
    render(){
        return(
            <div className="main">
            <div className="cart">
            <div className="cart-container">
               {
                   this.state.cartDetails.map((books) => (
                    <div key={books.bookId} className="book-container">
                        
                    </div>
                   ))
               }
            </div>
            <div className="button-container">
                <button className="place-order" onClick={(e)=>this.props.togglePanel(e)}>PLACE ORDER</button>
            </div>
        </div>
        </div>
        );
    }
}

export default CartPage;
